'''Đào Thị Hồng Nhung''' (sinh ngày 14 tháng 6 năm 1999 tại [[Thuận Thiên (xã)|Thuận Thiên]], [[Kiến Thụy]], [[Hải Phòng]]) là một [[vận động viên]] [[võ gậy]] người [[Việt Nam]]<ref>{{Chú thích web|url=http://anhp.vn/vinh-danh-doan-the-thao-hai-phong-dat-thanh-tich-xuat-sac-tai-dai-hoi-the-duc-the-thao-dong-nam-a--seagames-30-d31673.html|tựa đề=Vinh danh đoàn thể thao Hải Phòng đạt thành tích xuất sắc tại SEA Games 30|url-status=live}}</ref>. Trong suốt sự nghiệp thi đấu của mình, Nhung giành được 8 huy chương vàng, bạc và 2 huy chương đồng trên mọi đấu trường. Trong số đó là tấm huy chương vàng cá nhân tại [[Đại hội Thể thao Đông Nam Á 2019|SEA Games 30]] ở hạng cân dưới 60kg dành cho nữ<ref>{{Chú thích web|url=https://laodong.vn/the-thao/dieu-uoc-ngay-cuoi-nam-cua-co-gai-vang-the-thao-hai-phong-779817.ldo|tựa đề=Điều ước ngày cuối năm của cô gái vàng thể thao Hải Phòng|url-status=live}}</ref>.
